import "./App.css";
import "./styles.css";
import "~bootstrap/scss/bootstrap";
import "./App.scss";

function App() {
  return (
    <div className="App">
      <Header />
      <Menu />
      <Mangas />
    </div>
  );
}

function Header() {
  return (
    <div className="logo">
      <img src="lezhin.png" alt="Lezhin Logo" />;
    </div>
  );
}

function Menu() {
  return (
    <div className="menu">
      <ul>
        <button className="btn2">RECENT</button>
        <button className="btn2">SUBSCRIBED</button>
        <button className="btn2">DOWNLOADS</button>
        <button className="btn2">UNLOCKED</button>
        <button className="btn2">CREATORS</button>
        <button className="btn2">COMMENTS</button>
      </ul>
    </div>
  );
}

function Mangas() {
  return (
    <Carousel>
      <Carousel.Item>
        <ExampleCarouselImage text="First slide" />
        <Carousel.Caption>
          <h3>First slide label</h3>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <ExampleCarouselImage text="Second slide" />
        <Carousel.Caption>
          <h3>Second slide label</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <ExampleCarouselImage text="Third slide" />
        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default App;
